INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(4, 1, 'About Us', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;p { margin-bottom: 0.25cm; direction: ltr; line-height: 120%; text-align: left; widows: 2; orphans: 2; }a:link { color: rgb(119, 119, 121); text-decoration: none; }\r\n&lt;/style&gt;\r\n&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; background: #fdfdff; line-height: 0.48cm&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Welcome to India’s&amp;nbsp;fastest growing&amp;nbsp;online party supply store.&amp;nbsp;Our company motto is to help our customers celebrate all their special occasions with precious memories and great products that are carefully packed. We take care to ensure items are shipped se&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;c&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;urely and quickly right to your door.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; background: #fdfdff; line-height: 0.48cm&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Mypartyshoponline.com mission is to provide a huge and exclusive range of party supplies to customers. Our goal is to continually look for new and unique products to offer our customers. We strive to carry only&amp;nbsp;party supplies&amp;nbsp;made of high quality and to offer outstanding customer service. We carry our own entire inventory and refuse to drop-ship as part of our commitment to customer service so customers don''t have to worry about back-ordering or long border delays. &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; background: #fdfdff; line-height: 0.48cm&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Our company wants to offer our customers time-saving convenience along with ease of ordering by, web, phone, or email. We also want to save our customers the hassle of driving to stores to complete a child or adult’s birthday party&amp;nbsp;theme or other special occasion. Customers can also save money through our Party Packages (Coming&amp;nbsp;soon)&amp;nbsp;that bundle up all the party supplies you need to create a fantastic party at a savings over individual pricing.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; background: #fdfdff; line-height: 0.48cm&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Check back often for special promotions and offers or sign up for email updates that include special member coupons, offers, new product launches, and a quarterly newsletter with party tips. Follow us on Facebook &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;a href=&quot;http://www.facebook.com\\mypartyshoponline&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;www.facebook.com\\mypartyshoponline&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/a&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt; for the most up to date information and offers.&amp;nbsp;If you have any questions or concerns or would like to give us feedbacks please email us at: &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;a href=&quot;mailto:mypartyshopdelhi@gmail.com&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;contactus@mypartyshoponline.com&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/a&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt; or call us at 011-42740195.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; background: #fdfdff; line-height: 0.48cm&quot;&gt;&lt;br /&gt;\r\n&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Enjoy and celebrate your special occasions!&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n'),
(5, 1, 'Terms &amp; Conditions', '&lt;p&gt;&lt;strong&gt;Terms &amp;amp; Conditions&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Registration&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;You have to register an account on our website mypartyshoponline.com to make an online purchase. Once registration is completed you can go ahead with your shopping and registration is free of cost. By registering you will be able to get details of your past orders, products ordered, order status and date of purchase and delivery. It will help you for a faster and easier shopping .&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Ordering&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;When you confirm the order and it’s shipped then it cannot be cancelled. When the order is submitted once it is not possible to make changes in that so if you want to add some more items kindly place a new order. If order is cancelled due to product being out of stock or our inability to deliver the order within the agreed time frame, full amount paid for the product will be refunded.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Return policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Customer satisfaction is our main motto.&lt;/p&gt;\r\n\r\n&lt;p&gt;There are some conditions for our return policy which are as follows:&lt;/p&gt;\r\n\r\n&lt;p&gt;1.If you have received wrong/damaged of defective product then please feel free to return us back within 15 days of delivery.&lt;/p&gt;\r\n\r\n&lt;p&gt;Note: Please report us within 24 hours of delivery of wrong/damaged or defective product through email. If you are not able to inform us within 24hrs then mypartyshoponline.com shall not be held liable for not replacing or exchanging that order.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. The items should not be opened or used i.e. it should be in original packing with all labels and tags on it.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Please note that balloons are not returnable or exchangeable.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. The item which has to be returned should be stated on the invoice.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Please make sure that you use reliable courier service that has tracking option of the shipment as the replacement can be processed only once the item is received in as is condition.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. The company cannot accept responsibility for loss or damage during return transit. There are no RETURNS ON SALE OR CLEARANCE ITEMS&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Payment and pricing&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Mypartyshoponline.com reserves the rights to make any changes in prices, products and services available in the website.&lt;/p&gt;\r\n\r\n&lt;p&gt;We accept INR only.&lt;/p&gt;\r\n\r\n&lt;p&gt;Following payment options are available&lt;/p&gt;\r\n\r\n&lt;p&gt;Debit cards, Credit cards (visa/master)&lt;/p&gt;\r\n\r\n&lt;p&gt;Net banking&lt;/p&gt;\r\n\r\n&lt;p&gt;Cash cards ( airtel money, ITZ cash cards, YPAY, etc.)&lt;/p&gt;\r\n\r\n&lt;p&gt;Note: If you have opted for net banking, you have to inform mypartyshopinline.com through email with order number and amount. Orders will only be fulfilled after the bank transfer has been done.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our bank account details will be provided during the checkout process and in the Order Confirmation email sent to you.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Termination:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;​Mypartyshoponline.com may suspend or terminate your use of the Website or any Service if it believes, in its sole and absolute discretion that you have breached any of the Terms.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you or mypartyshoponline.com terminates your use of the Website or any Service, mypartyshoponline.com may delete any content or other materials relating to your use of the Service and mypartyshoponline.com will have no liability to you or any third party for doing so.&lt;/p&gt;\r\n\r\n&lt;p&gt;You shall be liable to pay for any Service or product that you have already ordered till the time of Termination by either party whatsoever.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Display of products&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The actual colors you see will depend on your screen resolution and configuration, Please note that colors vary from screen to screen, and most computer monitors will differ from the actual printed output. So the actual color of the product may vary as it appears on your screen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Mypartyshoponline.com is not responsible for the resulting color variations as there are a vast number of variables available for printing, THERE WILL BE NO REFUNDS and no design revisions of colors if you do not like the colors after printing or receiving the goods.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;Balloons and other inflatable items&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;All balloons (latex or Foil) and other inflatable items are sent deflated to the customers, We do not supply inflated balloons anywhere. The product images that you see on the website is to only show the customers the colors, size and print that comes out as the result of inflation.&lt;br /&gt;\r\n&lt;strong&gt;Warning:Children under 10 years can choke or suffocate on uninflated or broken balloons. Adult supervision required. Keep uninflated balloons away from children. Dispose broken balloons immediately&lt;br /&gt;\r\nGoverning Law&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;These terms shall be governed by and constructed in accordance with the laws of India without reference to conflict of laws principles, and disputes arising in relation hereto shall be subject to the exclusive jurisdiction of the courts at Delhi, India.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Report Abuse&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you come across any abuse or violation of these Terms, please report to contactus@mypartyshoponline.com&lt;/p&gt;\r\n'),
(7, 1, 'Refund Policy', '&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 0cm; direction: ltr; line-height: 16px; widows: 2; orphans: 2; color: rgb(80, 80, 80); font-family: Lato, Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;&lt;font style=&quot;box-sizing: border-box; font-size: 10pt;&quot;&gt;&lt;font face=&quot;Arial, serif&quot; style=&quot;box-sizing: border-box;&quot;&gt;Refund Once the order has been cancelled, Buyer will receive the refund within 2 to 3 days. The refund will be made to the same payment option(s) originally used to pay for the order. If the payment was by Credit Card or Net-Banking, mypartyshoponline.com will refund the Credit Card or Net-Banking account. Note: For all products live on mypartyshoponline.com, inventory levels are based on demand and price forecasting, availability and replenishment lead times. As this is an on-going process and complex, some products may go out of stock despite our best efforts. Prices and availability of items/products are subject to change without prior notice at the sole discretion of mypartyshoponline.com.&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 0cm; direction: ltr; line-height: 16px; widows: 2; orphans: 2; color: rgb(80, 80, 80); font-family: Lato, Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 0cm; direction: ltr; line-height: 16px; widows: 2; orphans: 2; color: rgb(80, 80, 80); font-family: Lato, Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;font style=&quot;box-sizing: border-box; font-size: 10pt;&quot;&gt;&lt;font face=&quot;Arial, serif&quot; style=&quot;box-sizing: border-box;&quot;&gt;Return Policy :&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 0cm; direction: ltr; line-height: 16px; widows: 2; orphans: 2; color: rgb(80, 80, 80)