(8, 1, 'Disclaimer', '&lt;p style=&quot;font-size: 13px; margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Mypartyshoponline.com does not represent or warrant that the information contained in this website is accurate and complete. We are not be responsible or liable for any damages of any kind whatsoever arising out of, caused by or related to your use of this website. The information, images, photographs, trademarks, products and in general the elements and material that you will find on this website are disclosed only for promotional and advertising purposes; you may download or copy any of such elements and material only for private, personal and not commercial use. Mypartyshoponline.com makes no warranties of the absence of malicious programs (such as viruses, bugs or trojan horses).&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; background: rgb(253, 253, 255);&quot;&gt;&lt;strong&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Copyright :&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;This website contains information, images, photographs, logos, music, video, trademarks, products, advertising etc. which are and will remain the exclusive property of Mypartyshoponline.com. Said material is protected against unauthorized use by copyrights and trademark laws. No right, title and/or interest in any material or software may be deemed assigned to you as a result of any such download or copying. You may not reproduce, totally or in part (except for private, personal and not commercial use), distribute, publish, transmit, modify totally or in part, or sell any of such information, images, photographs, trademarks, products and in general elements and material contained in this website.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n'),
(6, 1, 'Shipping / Delivery Policy', '&lt;p style=&quot;margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; font-size: 13px; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Based on our very finely tuned prices we provide online payment shipping options to give you the convenience of shopping at mypartyshoponline.com.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; font-size: 13px; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;If your order value is below Rs. 1000, an additional Rs. 150 is added to your invoice value to meet the cost of logistics before you exit shopping cart. This cost is subject to revision without any prior notice. &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; font-size: 13px; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Orders are processed on all working days from Monday to Saturday. Order received after Saturday evening or on Sunday will be processed on the next working day except for other holidays. &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.53cm; direction: ltr; line-height: 0.48cm; widows: 2; orphans: 2; font-size: 13px; background: rgb(253, 253, 255);&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font style=&quot;font-size: 10pt;&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Orders will be shipped to the customer within 3 to 4 days of receipt of orders.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n'),
(3, 1, 'Privacy Policy', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;p { margin-bottom: 0.25cm; direction: ltr; line-height: 120%; text-align: left; widows: 2; orphans: 2; }\r\n&lt;/style&gt;\r\n&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;strong&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Privacy&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Mypartyshoponline.com does not sell its customer information and the information that is collected, is for company use only.&amp;nbsp; We feel customers have the right to shop without worry about third parties attaining information about them. We do not store credit card information either on our website or in our warehouse offices, when you submit an order on our site it is encrypted and sent to our merchant bank right away. We use 256 bit encryption, the highest level available&amp;nbsp;and use anti-hacking software and website monitoring to protect our customers and keep our shopping cart secure.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;strong&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;What we collect from you?&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;Mypartyshoponline.com will collect some important information from you such as name, email address, demographic information such as postcode, preferences, and interests. We may also collect information about the transactions you undertake including payment options used. &lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;strong&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;What we will do with this information?&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;These all information will be collected to serve you better. Our main motto is customer satisfaction. This information will help us to notify you about the changes in website, services, products and special offers and promotions. It will also help us for internal record keeping and will help us to improve our services. We may use the information to customize the website according to your interests.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;strong&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Payment&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;All orders must be paid for prior to shipping. VISA, MasterCard etc. accepted along with net banking and cash cards. For net banking items will not be shipped until payments are credited in our account. CREDIT CARD SECURITY: mypartyshoponline.com takes the protection of their customer’s credit card information very seriously. &lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;strong&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;Returns&lt;/font&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom: 0.35cm; line-height: 115%&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;font size=&quot;2&quot; style=&quot;font-size: 10pt&quot;&gt;&lt;font face=&quot;Arial, serif&quot;&gt;&lt;font color=&quot;#7f7f7f&quot;&gt;&lt;span lang=&quot;en-GB&quot;&gt;Customers are to notify the company of wrong/damaged or defective within 24 hours of receiving package. Items must be returned within 15 business days to exchange. Special Order items cannot be returned. The company cannot accept responsibility for loss or damage during return transit. There are no RETURNS ON SALE OR CLEARANCE ITEMS.&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n');
