(540, 1, 'Shot Glasses with White Beads', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; height=&quot;104&quot; width=&quot;948&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col width=&quot;282&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;100&quot;&gt;\r\n			&lt;td class=&quot;xl65&quot; height=&quot;100&quot; style=&quot;height:75.0pt;width:212pt&quot; width=&quot;282&quot;&gt;Enjoy your drink in the coolest way now. You wont lose your drink now because now you have a plastic shot glass attached with white coloured beads necklace. Just wear it and enjoy your drink!!&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', 'Enjoy your drink in the coolest way now. You wont lose your drink now because now you have a plastic shot glass attached with white coloured beads necklace. J', 'Shot,Glasses,with,White,Beads', '', '', '', ''),
(347, 1, 'Turquoise Lace Eye Masks With Feather', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;260&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col width=&quot;260&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;160&quot;&gt;\r\n			&lt;td class=&quot;xl65&quot; height=&quot;160&quot; style=&quot;height:120.0pt;width:195pt&quot; width=&quot;260&quot;&gt;\r\n			&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;260&quot;&gt;\r\n				&lt;colgroup&gt;\r\n					&lt;col width=&quot;260&quot; /&gt;\r\n				&lt;/colgroup&gt;\r\n				&lt;tbody&gt;\r\n					&lt;tr height=&quot;140&quot;&gt;\r\n						&lt;td class=&quot;xl65&quot; height=&quot;140&quot; style=&quot;height:105.0pt;width:195pt&quot; width=&quot;260&quot;&gt;Try this enchanting fancy eye mask in pink colour. It has a chandelier net covering and a lace border. It has a beautiful feather on one side for enhanced look. It will transform your disguised look at the next masquerade party!! Try it now!&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', 'Try this enchanting fancy eye mask in pink colour. It has a chandelier net covering and a lace border. It has a b', 'Turquoise,Lace,Eye,Masks,With,Feather', '', '', '', ''),
