(288, 1, 'Bunny Hair Band(white and pink)', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; height=&quot;105&quot; width=&quot;948&quot;&gt;\r\n	&lt;colgroup&gt;\r\n		&lt;col width=&quot;302&quot; /&gt;\r\n	&lt;/colgroup&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr height=&quot;105&quot;&gt;\r\n			&lt;td class=&quot;xl65&quot; height=&quot;105&quot; style=&quot;height:78.75pt;width:227pt&quot; width=&quot;302&quot;&gt;This cute bunny hairband is for all the young ladies at the hens party. Its light pink and white in colour made of soft velvet fabric. The hairband is wrapped with fabric for comfort. One size fits all!!&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', 'This cute bunny hairband is for all the young ladies at the hens party. Its light pink and white in colour made of soft velvet fabric. The hairband is wrapped', 'Bunny,Hair,Band,white,and,pink', '', '', '', '');
